DELIMITER $$
--
-- Events
--
CREATE DEFINER=`root`@`localhost` EVENT `update_urls` ON SCHEDULE EVERY 1 HOUR STARTS '2023-05-01 03:29:47' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  UPDATE users
  SET urlsPerMonth = 0
  WHERE (pricePlan = '0' AND freeTrialExpiryDate < NOW())
     OR (pricePlan IN ('1', '2') AND expiryDate < NOW());
END$$

CREATE DEFINER=`root`@`localhost` EVENT `check_freeTrial_Expiry` ON SCHEDULE EVERY 1 MINUTE STARTS '2023-04-28 16:49:36' ON COMPLETION NOT PRESERVE ENABLE DO UPDATE users
  SET pricePlan = 'None'
  WHERE freeTrialExpiryDate < NOW() AND pricePlan = '0'$$

CREATE DEFINER=`root`@`localhost` EVENT `update_reco` ON SCHEDULE EVERY 1 HOUR STARTS '2023-04-30 19:00:54' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  UPDATE users
  SET recoPerMonth = 0
  WHERE (pricePlan = '0' AND freeTrialExpiryDate < NOW())
