END$$

CREATE DEFINER=`root`@`localhost` EVENT `update_upload_size` ON SCHEDULE EVERY 1 HOUR STARTS '2023-05-01 03:28:58' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  UPDATE users
  SET uploadSizePerMonth = 0
  WHERE (pricePlan = '0' AND freeTrialExpiryDate < NOW())
     OR (pricePlan IN ('1', '2') AND expiryDate < NOW());
END$$

CREATE DEFINER=`root`@`localhost` EVENT `check_active_transactions` ON SCHEDULE EVERY 1 MINUTE STARTS '2023-05-20 03:23:17' ON COMPLETION NOT PRESERVE ENABLE DO UPDATE transactions
SET isExpired = 'Expired'
WHERE (userID, transactionID) IN (
  SELECT t1.userID, t1.transactionID
  FROM transactions t1
  WHERE t1.isExpired = 'Active'
  AND EXISTS (
    SELECT 1
    FROM transactions t2
    WHERE t2.userID = t1.userID
    AND t2.isExpired = 'Active'
    AND t2.transactionID > t1.transactionID
  )
)$$

